angular.module('app.controllers')
  .controller('editApparelCtrl', function($scope, $rootScope, $cordovaGeolocation, $cordovaActionSheet, $ionicHistory, $ionicLoading, $ionicSlideBoxDelegate, $timeout, $state, $stateParams, $auth, $q, Apparel, ApparelRating, Upload, CurrentCamera, FileManager, PropertyGroup) {
    var currentController = this;
    $scope.savingEntry = false;
    $scope.apparelSwiper = {};
    $scope.propertyGroups = [];

    $scope.loadingRootGroups = false;

    $scope.groupPropertySelectionChanged = function(group) {
      if (!$scope.loadingRootGroups) {
        // console.log('groupPropertySelectionChanged');
        doGroupPropertySelectionChanged(group, $scope.entry.apparel_property[group.prop_name], $scope.entry);
      }
    }

    function doGroupPropertySelectionChanged(group, newValue, entry) {
      if (group.childrenGroups) {
        for (var i = 0; i < group.childrenGroups.length; i++) {;
          var childGroup = group.childrenGroups[i];
          var childIndex = $scope.propertyGroups.indexOf(childGroup);
          if (childIndex > -1) {
            $scope.propertyGroups.splice(childIndex, 1);
            doGroupPropertySelectionChanged(childGroup, null, entry);
          }
          if (childGroup.unregister) {
            childGroup.unregister();
            delete childGroup['unregister'];
          }
        }
      }

      if (newValue) {
        if (!group.loading) {
          group.loading = true;
          loadChildGroups(group, newValue, entry).then(function() {
            group.loading = false;
          }, function() {
            group.loading = false;
          });
        }
      } else {
        // caso o valor da propriedade esteja preenchida entao limpa
        entry.apparel_property[group.prop_name] = null;
      }
    };

    function doAddPropertyGroup(group, parentGroup, entry) {
      return $q(function(resolve, reject) {
        $scope.propertyGroups.push(group);
        var groupIndex = $scope.propertyGroups.length - 1;
        if (parentGroup) {
          if (!parentGroup.childrenGroups)
            parentGroup.childrenGroups = [];
          parentGroup.childrenGroups.push(group);
        }

        // group.unregister = $scope.$watch('entry.apparel_property.' + group.prop_name, function(newValue) {
        //   if (!$scope.loadingRootGroups)
        //     groupPropertySelectionChanged(group, newValue, $scope.entry || entry);
        // });
        var selectedId = entry.apparel_property[group.prop_name];
        if (selectedId) {
          loadChildGroups(group, selectedId, entry).then(function(childrenGroups) {
            resolve(group);
          }, reject);
        } else {
          entry.apparel_property[group.prop_name] = null;
          resolve(group);
        }
      });
    }

    function loadRootGroups(entry) {
      return $q(function(resolve, reject) {
        PropertyGroup.root().then(function(groups) {
          var promises = [];
          for (var i = 0; i < groups.length; i++) {
            promises.push(doAddPropertyGroup(groups[i], null, entry));
          }
          Promise.all(promises).then(resolve, reject);
        }, reject);
      });
    }

    function loadChildGroups(parentGroup, selectedId, entry) {
      return $q(function(resolve, reject) {
        PropertyGroup.children(parentGroup.id, selectedId).then(function(groups) {
          var promises = [];
          for (var i = 0; i < groups.length; i++) {
            promises.push(doAddPropertyGroup(groups[i], parentGroup, entry));
          }
          Promise.all(promises).then(function(data) {
            resolve(groups);
          }, reject);
        }, reject);
      });
    }

    $scope.onReadySwiper = function(swiper) {
      $scope.apparelSwiper = swiper;
      $timeout(function() {
        if ($scope.apparelSwiper.update)
          $scope.apparelSwiper.update();
      }, 200);
    };

    function refereshApparelSwiper(onRefreshed) {
      if ($scope.apparelSwiper.update) {
        $timeout(function() {
            // $scope.apparelSwiper.update();
            $scope.apparelSwiper.update();
            if (onRefreshed)
              onRefreshed();
          }, 100);
      }
    };

    $scope.getNewPhoto = function() {
      var deferred = $q.defer();

      var options = {
        title: t('apparel_form.messages.new_photo.title'),
        buttonLabels: [t('apparel_form.messages.new_photo.buttons.new'), t('apparel_form.messages.new_photo.buttons.gallery')],
        addCancelButtonWithLabel: t('apparel_form.messages.new_photo.buttons.cancel'),
        androidEnableCancelButton : true,
        winphoneEnableCancelButton : true
        // , addDestructiveButtonWithLabel : 'Delete it'
      };

      $cordovaActionSheet.show(options)
        .then(function(btnIndex) {
          console.log(btnIndex);
          var getPicture = false;
          if (btnIndex == 1)
            getPicture = CurrentCamera.getPictureFromCamera;
          else if (btnIndex == 2)
            getPicture = CurrentCamera.getPictureFromLibrary;

          if (getPicture) {
            var options = { destinationType: Camera.DestinationType.DATA_URL,
              targetWidth: 400,
              targetHeight: 400,
              allowEdit: true
            };

            getPicture(options).then(
              function(res) {
                deferred.resolve(res);
              }, function(err) {
                deferred.reject(err);
              });
          }
          else {
            deferred.reject('Cancelled');
          }
        }, function(err) {
          deferred.reject(err);
        });

      return deferred.promise;
    };

    function moveToImage(imageIndex) {
      $timeout(function() {
        $scope.apparelSwiper.slideTo(imageIndex);
      }, 200);
    }

    $scope.editImage = function(url) {

    };

    $scope.newImage = function() {
      var isMob = window.cordova !== undefined;
      if (isMob) {
        $scope.getNewPhoto()
          .then(function(result) {
            $timeout(function() {
              $scope.entry.apparel_images.push({ data: result });
              $ionicSlideBoxDelegate.update();
              refereshApparelSwiper(function() {
                moveToImage($scope.entry.apparel_images.length - 1);
              });
            });
          }, function(error) {
            console.log(error);
          });
        } else {
          var exampleImage = { data: 'data:image/jpg;base64,' };
          $scope.entry.apparel_images.push(exampleImage);
          refereshApparelSwiper(function() {
            moveToImage($scope.entry.apparel_images.length - 1);
          });
        }
    };

    $scope.filterOnlyNotDestroyed = function(element) {
      return !element.hasOwnProperty('_destroy') || !element._destroy;
    };

    $scope.removeImage = function(image) {
      $rootScope.showConfirmPopup(t('apparel_form.messages.confirm_delete.title')).then(function(res) {
        if(res) {
          if (image.hasOwnProperty('id') && image.id > 0) {
            image['_destroy'] = true;
          } else {
            var index = $scope.entry.apparel_images.indexOf(image);
            if (index > -1)
              $scope.entry.apparel_images.splice(index, 1);
          }
          $ionicSlideBoxDelegate.update();
          refereshApparelSwiper();
        }
      });
    };

    $scope.makeMainImage = function(image) {
      $rootScope.showConfirmPopup(t('apparel_form.messages.confirm_main.title')).then(function(res) {
        if(res) {
          $timeout(function() {
            var index = $scope.entry.apparel_images.indexOf(image);
            // verifica se achou e se ja no  a primeira
            if (index > 0) {
              $scope.entry.apparel_images[0].sort_order = 2;
              $scope.entry.apparel_images.splice(index, 1);
              $scope.entry.apparel_images.unshift(image);
              image.sort_order = 1;
              $ionicSlideBoxDelegate.update();
              refereshApparelSwiper(function() {
                moveToImage(0);
              });
            }
          });
        }
      });
    };

    $scope.submit = function() {
      var isNew = !$scope.entry.hasOwnProperty('id') || $scope.entry.id < 1;
      if (!$scope.savingEntry) {
        if ($scope.entry.hasImages()) {
          $rootScope.showReadableLoading(t('apparel_form.saving.message'));

          $scope.savingEntry = true;
          $scope.entry.save().then(function(data) {
            data.update_owned_cache();

            $timeout(function() {
              $ionicHistory.nextViewOptions({ disableBack: true });
              $rootScope.hideReadableLoading();

              if (isNew) {
                $rootScope.showToastMessage(t('apparel_form.messages.new_saved'));
                $state.go('menu.apparel');
              } else {
                $state.go('menu.apparel_list');
              }
            });
          }, function(err) {
            $rootScope.hideReadableLoading();
            console.log(err);
            $scope.savingEntry = false;
          });
        } else {
          $rootScope.showToastMessage(t('apparel_form.messages.error.no_images'), 2000);
        }
      } else {
        // $rootScope.showToastMessage(t('edit_apparel.form.already_saving'));
      }
    };

    $scope.cancel = function() {
      var isNew = !$scope.entry.hasOwnProperty('id') || $scope.entry.id < 1;
      if (!isNew) {
        $ionicHistory.goBack();
      }
    };

    function fixForDynamicSelects() {
      for (var i = 0; i < $scope.propertyGroups.length; i++) {
        var group = $scope.propertyGroups[i];
        if ($scope.entry.apparel_property[group.prop_name]) {
          var select = document.getElementById(group.prop_name);
          if (select)
            select.value = $scope.entry.apparel_property[group.prop_name].toString();
        }
      }
    }

    function setCurrentApparel() {
      $scope.loadingRootGroups = true;
      if ($stateParams.hasOwnProperty('id')) {
        Apparel.get($stateParams["id"]).then(function(apparel) {
          $timeout(function() {
            if (!apparel.apparel_property)
              apparel.apparel_property = { };

            loadRootGroups(apparel).then(function() {
              $scope.entry = apparel;
              $ionicSlideBoxDelegate.update();
              refereshApparelSwiper();

              $timeout(function() {
                $scope.loadingRootGroups = false;
                fixForDynamicSelects();
              });
            }, function(error) {
              console.error(error);
              $timeout(function() {
                $scope.loadingRootGroups = false;
              });
            });

          });
        }, function(error) {
          $timeout(function() {
            $rootScope.showToastMessage(t('apparel_form.messages.error.loading'));
            $ionicHistory.nextViewOptions({ disableBack: true });
            $state.go('menu.apparel_list');
          });
        });
      } else {
        var apparel = new Apparel({apparel_images: [ ], apparel_tags: [], apparel_property: {}});
        loadRootGroups($scope.entry).then(function() {
          $scope.$apply(function() {
            $scope.entry = apparel;
            $ionicSlideBoxDelegate.update();
            refereshApparelSwiper();
          });

          $timeout(function() {
            $scope.loadingRootGroups = false;
          });
        }, function(error) {
          console.error(error);
          $timeout(function() {
            $scope.loadingRootGroups = false;
          });
        });
      }
    }
    $scope.$on('$ionicView.loaded', function(event) {
      setCurrentApparel();
    });

    updateLatLng($cordovaGeolocation, $auth, $q);
  });
